rcentile values provided in the report. This helps in understanding how far the metric values deviate from the normal range.\n\nBy following these steps, users can effectively identify and investigate anomalies and outliers in driver performance metrics.\n\n\u003e **_NOTE:_** The sanity check should ideally be true for all entries in this report. However, in future iterations of this report, it will be possible to toggle the percentile values used for analyzing the data. Users will be able to customize both the percentile value that defines the normal range and the percentile value that identifies an anomaly. This feature will be particularly useful for examining extreme values that fall within the required percentile range but still may be of interest for further investigation.]]\u003e\u003c/Text\u003e\u003cHTML\u003e\u003c![CDATA[\u003cstyle type=\"text/css\"\u003e\n#T_ba77d_row0_col3, #T_ba77d_row0_col5, #T_ba77d_row1_col3, #T_ba77d_row2_col4, #T_ba77d_row3_col5, #T_ba77d_row4_col4, #T_ba77d_row5_col3, #T_ba77d_row6_col3, #T_ba77d_row7_col5, #T_ba77d_row8_col5, #T_ba77d_row9_col5, #T_ba77d_row10_col5, #T_ba77d_row11_col2, #T_ba77d_row11_col3, #T_ba77d_row11_col4, #T_ba77d_row12_col4, #T_ba77d_row13_col5, #T_ba77d_row14_col2, #T_ba77d_row14_col3, #T_ba77d_row14_col4, #T_ba77d_row15_col3, #T_ba77d_row16_col3, #T_ba77d_row17_col2, #T_ba77d_row18_col3, #T_ba77d_row19_col5, #T_ba77d_row20_col4, #T_ba77d_row21_col4, #T_ba77d_row22_col3, #T_ba77d_row23_col5, #T_ba77d_row24_col2, #T_ba77d_row25_col4, #T_ba77d_row26_col3, #T_ba77d_row27_col4, #T_ba77d_row28_col4, #T_ba77d_row29_col2, #T_ba77d_row29_col3, #T_ba77d_row29_col4, #T_ba77d_row29_col5, #T_ba77d_row30_col5, #T_ba77d_row31_col4, #T_ba77d_row32_col3, #T_ba77d_row33_col2, #T_ba77d_row34_col2, #T_ba77d_row35_col3, #T_ba77d_row36_col5, #T_ba77d_row37_col4, #T_ba77d_row38_col2, #T_ba77d_row39_col5, #T_ba77d_row40_col3, #T_ba77d_row41_col3, #T_ba77d_row42_col2, #T_ba77d_row43_col2, #T_ba77d_row44_col5, #T_ba77d_row45_co
